INSERT INTO xcart_products VALUES (92,'SKU92','Cranium','master','',1.00,46.65,'The outrageous new board game for your whole brain, containing 14 fun activities giving everyone a chance to shine.','',100,2,'Y',2147483647,1,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (10,'SKU10','Flash 5 for Windows and Macintosh','master','',1.00,79.99,'I am fonder of Macromedia Flash than just about any tool, and I feel much the same way about Peachpit\'s Visual QuickStart Guides; so, the idea of a Visual QuickStart Guide about Flash 5 makes me weak in the knees.','',100,10,'Y',2147483647,5,0,1,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (12,'SKU12','Photoshop 6 Down and Dirty Tricks','master','',1.00,79.99,'This is one of the very best books I\'ve seen to date on Photoshop Tricks.Do yourself a favor and add this powerhouse to your Photoshop arsenal.','',88,11,'Y',2147483647,30,12,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (201,'SKU201','Motorola StarTAC ST7797','master','',1.00,188.89,'<ul type=\"disc\"><li>Lightweight, efficient design<li>Solid construction, intuitive keypad and controls<li>Vibrating call alert<li>Dual NAM capability<li>Up to 170 hours\' standby, 130 minutes\' talk time with standard battery</ul>','',95,9,'Y',2147483647,3,5,1,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (111,'SKU111','Vidocq','master','',1.00,44.44,'Paris. 1830. In the heart of the town, Vidocq, a famous detective, disappeared as he fights the Alchemist, an assassin that he has been pursuing for a few months. His young biographer, Etienne Boisset, decides to have revenge on Vidocq\'s death and takes on the investigation.','',100,2,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (86,'SKU86','Rock \'N Roll Ernie','master','',1.00,13.33,'Here\'s a side of Sesame Street\'s Ernie that you\'ve probably never seen before.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (85,'SKU85','RAD Robot (27 MHz)','master','',1.00,106.65,'The ultimate, high performance Remote Control Robot! Tough treads allow RAD to conquer rough terrain indoors or outdoors. With dual-speed, RAD goes forward, backward, left and right, and does a 360 degree spin.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (83,'SKU83','ViaVoice Pro 7.0 Millennium Edition','master','/provider/via_voice_70.zip',1.00,45.32,'<b>Features:</b><ul type=\"disc\"><li>Use voice commands to control and navigate your desktop, applications, and the Internet<li>Input, edit, and format text by voice using Microsoft Word 97 and 2000; Microsoft Excel 97 and 2000; and Microsoft Outlook 97, 98, and 2000<li>Explore specialized topics such as Cuisine, Chatters Jargon, Business &amp; Finance, and Computer<li>Proofread your documents with the ViaVoice Outloud text-to-speech feature<li>Includes optional legal and medical dictionaries</ul>','',100,4,'Y',2147483647,4,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (80,'SKU80','Smash, Offspring','master','',1.00,18.65,'Call them the Nine Inch Nails of punk. Like NIN, the Offspring preserve the essential ingredients of their chosen genre--guitars grinding out three chords, shouted vocals,\r\nand plenty of vitriol--and layer them over a melodic base that packs considerable popular appeal. The singles from Smash, the Offspring\'s breakthrough album, still receive\r\nconsiderable radio airplay: \"Gotta Get Away,\" \"Come Out and Play,\" and \"Self Esteem.\" With these and Smash\'s 11 other tracks, the band chronicles the adolescent\r\nexperience with clarity and surprisingly incisive wit. That pretty much describes all of their albums, but this is the one to get. It\'s got more shape than their earlier material and\r\nisn\'t as disturbingly poppy as their more recent recordings; it\'s the perfect blend of riffs and rage.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (81,'SKU81','Songbird, Eva Cassidy','master','',1.00,15.84,'This release is a compilation of some of Eva\'s best and most popular recordings, including her incredible rendition of \"Somewhere Over the Rainbow.\" If you have all of her\r\nCDs as I do, and you can only take one along, you grab this one. This talented (understatement) singer\'s range is phenomenal. And the purity and beauty of her voice\r\ntouches your very heart and soul.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (82,'SKU82','Songs in A Minor, Alicia Keys','master','',1.00,16.77,'She may be beautiful, but Alicia Keys is a musician first and foremost. She plants herself firmly behind the piano keys on her debut, unlike many of the booty-waggin\' junior\r\ndivas who are crowding the R&amp;B videoscape these days. Though many of the tracks on Songs in A Minor are embellished with adolescent angst, this 20-year-old\'s\r\nsubstantial, gorgeously soul-drenched alto putties the cracks between notes with astonishing ease. \"Fallin\',\" the album\'s first single, showcases Keys at her best. She wails\r\nplaintively and passionately over rolling blues chords, in the tradition of the greats that this young talent clearly wants to align herself with--Stevie Wonder, Donny\r\nHathaway, and Aretha Franklin. She swoops and soars over the spicy, flamenco-fueled melody that opens \"Mr. Mann,\" one of the many winning tracks gathered here. And\r\nshe digs deep into a remake of the beloved Prince B-side, \"How Come U Don\'t Call Me Anymore?\" packing more heat into her melismatic wails than most singers twice her\r\nage.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (78,'SKU78','O Brother, Where Art Thou? Various Artists - Soundtrack','master','',1.00,17.71,'The best soundtracks are like movies for the ears, and O Brother, Where Art Thou? joins the likes of Saturday Night Fever and The Harder They Come as cinematic pinnacles\r\nof song. The music from the Coen brothers\' Depression-era film taps into the source from which the purest strains of country, blues, bluegrass, folk, and gospel music flow.\r\nProducer T Bone Burnett enlists the voices of Alison Krauss, Gillian Welch, Emmylou Harris, Ralph Stanley, and kindred spirits for performances of traditional material, in\r\narrangements that are either a cappella or feature bare-bones accompaniment. Highlights range from the aching purity of Krauss\'s \"Down to the River to Pray\" to the\r\nplainspoken faith of the Whites\' \"Keep on the Sunny Side\" to Stanley\'s chillingly plaintive \"O Death.\" The album\'s spiritual centerpiece finds Krauss, Welch, and Harris\r\nharmonizing on \"Didn\'t Leave Nobody but the Baby,\" a gospel lullaby that sounds like a chorus of Appalachian angels.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (79,'SKU79','Skin, Melissa Etheridge','master','',1.00,17.71,'During the dark days of the singer\'s split from Julie Cypher, her companion of 12 years, Melissa Etheridge retreated to her home studio to pen songs lit from within with her\r\nsearing pain and confusion. From those heart-wrenching sessions comes arguably Etheridge\'s finest work. She vents and rages and all but spits on her Tony Llama boots,\r\ngiving these 10 songs a depth and grit that she only hinted at in her prior six albums. And those early albums were plenty gritty. But early tunes such as \"Come to My\r\nWindow,\" and \"Yes I Am\" don\'t approach the naked vulnerability heard here--even though the breakup was hinted at in \"Stronger Than Me,\" on 1999\'s Breakdown. Skin\r\npeels back layers of Etheridge\'s pain and addresses her personal melodrama in such a compelling way that her despair is transmuted into true art, as she takes the listener\r\nthrough the stages of grief and recovery. And what a journey, beginning with the bristling \"Lover Please\" (\"Didn\'t I love you right / Then tell me where are you going dressed\r\nto kill tonight? / Oh, this one\'s gonna hurt like hell\") and ending with the stirring \"Heal Me,\" which features background vocals by famous pals Laura Dern and Meg Ryan.\r\nThat\'s almost all the help she has on the record; Etheridge plays almost all the instruments and penned all the songs. But, ultimately, Skin is the sound of one heart breaking.','',100,2,'Y',2147483647,1,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (77,'SKU77','Bach: Cello-Suiten / Mstislav Rostropovich','master','',1.00,41.76,'<b>Composer:</b> Johann Sebastian Bach<b><br />Performer:</b>Mstislav RostropovichEmd/Emi Classics - #55363 / June 13, 1995Audio CD / DDD / Number of Discs: 2','',100,2,'Y',2147483647,1,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (76,'SKU76','Bach\'s Goldberg Variations','master','',1.00,18.65,'As the legend goes, <i>Bach\'s Goldberg Variations</i>were written for an insomniac diplomat patron who desired music to help cheer him on lonely, sleepless nights. But the real legend is how Bach was able to produce, for an apparently throwaway occasion, one of the crowning masterpieces not only of the Baroque, but of all Western music. Here\'s a gathering of widely varied interpretations the music has inspired, from keyboard masters to arrangements for string orchestra, jazz trio, and even brass band.','',100,0,'Y',2147483647,6,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
