INSERT INTO xcart_products VALUES (191,'SKU191','Baldur`s Gate II Add On','master','',1.00,50.63,'Baldur`s Gate II: Throne of Bhaal takes players through an all-new storyline rich with intrigue and treachery as they unravel the mysteries of the Dungeon of Watcher`s Keep and explore other new areas such as the City of Saradush, the Fortified Monastery of Amkethran, Sendai`s Underdark Fortress and the player`s own Planar Stronghold. Throughout their journey, characters may reach up to level 40, made possible with a raised experience cap of 8 million points, quite possibly the highest level ever achieved by characters in any Advanced Dungeons &amp; Dragons computer game. Also included in the quest are over 40 new powerful high-level spells and abilities. The Wild Mage Character Kit will also be included to the already extensive class list allowing gamers to create a powerful new character able to cast spells with very unpredictable results. Baldur?s Gate II players will be pleased to hear that the Dungeon of Watchers Keep (the add-in section contained within the Throne of Bhaal expansion pack) is fully playable either while questing through their Baldur?s Gate II: Shadows of Amn adventure or while completing the Child of Bhaal Saga (as part of the add-on section of the Throne of Bhaal expansion). Baldur`s Gate II: Throne of Bhaal has shipped to retail for WindowsÆ95/98-based computers and gamers will need to own the original Baldur`s Gate II: Shadows of Amn in order to play.','',44,31,'Y',2147483647,8,56,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
