INSERT INTO xcart_products VALUES (89,'SKU89','Tatty Teddy bear','master','',0.50,11.30,'An adorable grey bear with the blue nose and patches is waiting to share all your love. <br /><br />\r\n\r\nLet a classic <i>Me to You</i> Tatty Teddy touch the heart of someone you know. Floppy and huggable, this plush bear has a lot of charisma and will be a companion in good times and bad. Whatever the occasion, Tatty Teddy gets the sentiment just right. 6 1/4 \" tall. Surface washable.\r\n','',20,0,'Y',1144836325,0,0,0,0.00,'N','Y',1,0,0,0,4,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (90,'BARBIE001','The Swan Barbie','master','',1.00,32.00,'The Swan Barbie depicts the style, beauty, and\r<br />grace of the elegant bird that she pays homage to.\r<br />Her off-white gown has a fitted bodice with beaded\r<br />shoulder straps and a flowing skirt with a tulle\r<br />petticoat underneath. A plume of black and white\r<br />feathers decorates the front of her skirt, while\r<br />a second tuft springs up from the back of the bodice.\r<br />Her black hair is fashioned in a sophisticated,\r<br />upswept style and topped with a beaded tiara and\r<br />yet more feathers. Her feet are shod in matching\r<br />off-white slippers, making one wonder if this\r<br />Barbie didn\'t step right out of \"Swan Lake.\"\r<br />Meant for collection rather than play, a stand is\r<br />included for displaying this beautiful doll.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (91,'SKU91','Alphabet Apple','master','',1.00,23.99,'The Alphabet Apple by V-tech is designed to let preschoolers take a good bite out of learning their letters. Insert two AA batteries (not included) into the sturdy-plastic,\r<br />portable unit, and youngsters can slide the \"worm\" in the apple to select one of five settings. The first four settings instruct kids in letter recognition and sounds, complete with\r<br />letter-finding games using the push buttons. A fifth option offers nine different melodies that play (regrettably, at a nonadjustable volume) at the press of a key. With its\r<br />colorful, kid-friendly design, the Alphabet Apple provides the seed for a solid core of learning.','',100,0,'Y',2147483647,2,0,2,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (110,'SKU110','Electrolux vacuum-cleaner','master','',1.00,742.05,'Electrolux carries a name as old and ask known as Amway. How? Because they make quality products, and they back them\r<br />                                           with warranty. Falling under the shadow of being just another product vended door to door by hardworking salesmen, it is\r<br />                                           hard to get the real scoup on the product till you have used it in your home.','',100,4,'Y',2147483647,2,0,1,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (112,'SKU112','Scary Movie 2','master','',1.00,39.77,'\'No Mercy. No Shame. No Sequel\' was the tag-line for \"Scary Movie\". In one sense, at least, they lied. The Wayans team is back with more of the same, this time targeting supernatural thrillers.\r<br />\r<br />Tim Curry plays a college professor who bribes a group of pupils with A-grades to spend the weekend in a haunted house, but the story really isn\'t the point here. As you might expect, the plot is largely a combination of the plots of the films it parodies, which include \"What Lies Beneath\", \"Hannibal\", and \"Hollow Man\".\r<br />\r<br />It was presumably the pre-title sequence, crammed full of urination, defecation, and projectile vomiting, which gave the film its 18 certificate. From then on, while many of the gags remain close to the bone, they\'re more cheeky and smutty than offensive.\r<br />\r<br />In an attempt to appeal to a more genteel audience, the Wayans brothers (Keenan, Marlon, and Shawn) also dig their teeth into the likes of \"Charlie\'s Angels\", and even The Weakest Link. A handful of jokes also shock with their unexpected cleanliness. If not belly laughs, there\'ll be frequent nods of acknowledgement.\r<br />\r<br />Unlike the father of all spoof movies \"Airplane\" - but like \"Scary Movie 2\" \'s wheelchair-bound mad scientist - this film can\'t really stand on its own two feet. It relies heavily on its audience having seen most of the films being aped. It can be funny to see one set of actors doing the same as you\'ve seen another set of actors doing, and even funnier still when there\'s a wicked twist thrown in to end the sequence, but if you haven\'t seen the target film, not only is it not funny, it becomes totally pointless.\r<br />\r<br />For more scary stuff check out Horror\'s New Face and our horror genre.\r<br />\r<br />\"Scary Movie 2\" is released in UK cinemas on Friday 7th September 2001.\r<br />\r<br />','',100,5,'Y',2147483647,1,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (87,'SKU87','Barbie as Snowflake','master','',1.00,19.97,'Barbie doll gets a standing ovation as the beautiful Snowflake from the beloved ballet, \"The Nutcracker.\" This doll is fourth in the Classic Ballet Series. Barbie looks breathtaking\r<br />\r<br />\r<br />in a glittering, white satin and blue tulle ballerina costume with a delicate snowflake pattern. She wears shimmery tights and pretty, blue toe shoes. Her crowning touch is a\r<br />\r<br />\r<br />silvery tiara. Barbie has special legs, so girls can really pose her in \"on-toe\" ballet positions.','',100,2,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (93,'SKU93','Lord of the Rings Board Game','master','',1.00,46.65,'Here\'s your chance to prove you are worthy to save Middle Earth. Enter the world envisioned in J.R.R. Tolkien\'s book Lord of the Rings and become a member of the\r<br />Fellowship. The goal of the game is to stop the Dark Lord Sauron from winning back the magic Ring, which Frodo has inherited and which Sauron would use to forever enslave\r<br />the land.','',80,9,'Y',2147483647,15,23,3,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (94,'SKU94','Monopoly Junior','master','',1.00,14.65,'Just like its big brother, Monopoly Jr. is big-time fun for everyone! Spend a day at the amusement park. Ride the roller coaster, bumper cars, or Ferris wheel. How about a\r<br />game of miniature golf or a visit to the haunted house? It\'s simple--set up ticket booths on as many boardwalk amusements as possible, then build your fortune collecting\r<br />the entrance fees as other players land on your properties. If someone else already owns an amusement, you pay up. Watch out--if one player owns both amusements of\r<br />the same color, you must pay them double! So have some fun. And don\'t forget--pass GO, collect $2.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (105,'SKU105','Fast &amp; furious (The Fast and the furious)','master','',1.00,46.47,'Call me naive, but until I saw director Rob Cohen\'s \"The Fast and the Furious,\" I didn\'t know there was a such thing as underground car racing gangs in the United States. Not being a mechanic or car aficionado, I also had no idea how cars could so quickly speed up to 140 mph. While the jury\'s still out on\r<br />how realistic \"The Fast and the Furious\" is concerning its details on automobiles and racing, I, nonetheless, learned quite a bit from the film--more so than any usual moviegoing experience. I also learned that no matter how many slam-bang action scenes are put into a movie, the entire effort cannot work without a serviceable screenplay. \r<br />\r<br />Set in the seedy world of street racing teams, Brian (Paul Walker) is an undercover cop who has managed to get in with one such group, led by Dominic Toretto (Vin Diesel). While his mission is to prove that they not only illegally race, but also hijack trucks on the side, Brian finds himself apprehensive of doing so when he not only becomes good friends with Dominic, but also falls for his sister, Mia (Jordana Brewster). \r<br />\r<br />The plot of \"The Fast and the Furious\" is such a flimsy amalgamation of cliches and tedium that it not only remains wholly predictable from beginning to end, but also doesn\'t even find its premise until at least a half-hour in. Until then, we are treated to literally one scene after the next of people racing hot--no, make that very hot--cars. When the story finally shifts into high gear and we find that Brian is, indeed, a cop, the stakes are undoubtedly heightened. Unfortunately, this means that the pacing must slow down and the characters actually have to speak. They are not helped much at all by the underwhelming screenplay by Gary Scott Thompson, Erik Bergquist, and David Ayer. That it took three separate people to pen such a thin script is quite humorous, and just a little mindboggling. \r<br />\r<br />The action sequences, by the way, are so thrilling that they almost single-handedly save the film from its countless flaws. The tight, precise editing aids in making each and every car racing sequence a high-throttle joy to behold, and a climactic scene involving a botched truck hijack is downright nailbiting. It\'s very easy to forget about such \"frivolous\" things as character involvement and story developments when your body is being overtaken by such rapid-fire images of excitement and danger. But once each scene has taken its toll, you are grounded back to the reasons why the movie, as a whole, is simply not finding the footing it should. \r<br />\r<br />The cast is professional and attractive, but little else (with two exceptions). Vin Diesel (2000\'s \"Pitch Black\"), that of the muscular build, shaved head, and baritone voice, turns in another effective, highly modulated performance as the loyal Dominic. As his younger sister, Mia, Jordana Brewster (2001\'s \"The Invisible Circus\") is a strong actress with a brain to go along with her stunning beauty. While it would have been nice to see Brewster act as more than virtual wallpapering, at least she has more to do than Michelle Rodriguez (2000\'s \"Girlfight\"), as Dominic\'s sensual, hard-edged girlfriend, Letty. Who knows if Rodriguez is any good? All she is asked to do is make brooding, \"I\'m-so-tough\" faces on cue. Finally, Paul Walker (2000\'s \"The Skulls\") gets his very first leading man role as undercover police officer Brian, and he doesn\'t impress. There just doesn\'t seem to be anything behind Walker\'s facial expressions, and so his character doesn\'t win the audience\'s sympathies as it should. \r<br />\r<br />Despite several slow patches and an ending that doesn\'t know when to quit (yet still manages to leave characters and relationships hanging without closure), \"The Fast and the Furious\" offers mindless summer movie fun for 105 minutes. If anything, the action leaves a cursory adrenaline rush. When the movie is over, though, don\'t expect to think about it again--because you won\'t.','',100,2,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
