INSERT INTO xcart_products VALUES (109,'SKU109','BRIDGET JONES\'S DIARY','master','',1.00,34.53,'In the romantic comedy BRIDGET JONES\'S DIARY, RenÈe Zellweger looks absolutely awful as Bridget Jones. With a splotchy complexion, bulges everywhere and stringy hair, Bridget eats, drinks and smokes too much. She also dresses like a carpet. Badly miscast as the British heroine, Zellweger, in a monotonic performance, never gives us much reason to care. \r<br />\r<br />Although Bridget has a serious and supposedly hopeless crush on her boss, Daniel Cleaver (Hugh Grant), Richard Curtis and Andrew Davies\'s script has Bridget and Daniel quickly hopping into bed together. In the role of the man clearly designed to be the only man to deserve her, Colin Firth plays the dour lawyer Mark Darcy like a man with a constant case of intestinal problems. In a one-dimensional part, Embeth Davidtz plays Natasha, Mark\'s anal-retentive fellow lawyer and would-be fiancÈe. \r<br />\r<br />Bridget, who writes in her diary in narration, is a 32 year old who worries about dying a spinster and being eaten alive by dogs. (No such luck.) Her television choices consist of things like the death scene from FATAL ATTRACTION followed by a nature program on humping lions. In case we forget how we\'re supposed to feel about Bridget\'s aspirations and emotions, the film\'s heavy musical accompaniment is also there to remind us. \r<br />\r<br />\"Stay calm -- can\'t get worse,\" Bridget admonishes herself when she is having yet another social disaster. I kept trying to remember that advice while waiting for the ending credits to arrive. \r<br />\r<br />BRIDGET JONES\'S DIARY runs a long 1:35. It is rated R for language and some strong sexuality and would be acceptable for most teenagers.','',100,2,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (108,'SKU108','Moulin Rouge','master','',1.00,46.47,'One does not watch Baz Luhrmann\'s phantasmagoric ode to Hollywood movie musicals of yore, \"Moulin Rouge,\" as much as one feels as if they\'re living it.\r<br />A trippy carnival ride through sensory overload and non-stop visual marvels, it is a wildly imaginative and sincerely audacious motion picture that has the ability to single-handedly revive one\'s faith in the movies, as they have begun to dwindle with the summer season currently upon us. \r<br />\r<br />The story is simple, yet powerful. Set in Paris, circa 1899, Christian (Ewan McGregor) is a penniless writer who has just arrived in the town of Monmartre, home of the infamous Moulin Rouge nightclub. When Christian has a chance encounter with a group of petty unconformists, led by dwarf Toulouse Lautrec (John Leguizamo), and helps them to come up with the lyrics of \"The Sound of Music\" for the musical revue they are preparing for the Moulin Rouge, they immediately hire him to be their writer. They also set up a meeting with gorgeous courtesan Satine (Nicole Kidman), whom they want for the female lead of what they have entitled \"Spectacular Spectacular!\" At first mistaking him for a wealthy duke, Satine falls instantly in love with Christian, and vice versa, much to the chagrin of the real duke (Richard Roxburgh), who has not only just staked a claim in Moulin Rouge, but has gotten the club\'s owner, Zidler (Jim Broadbent), to sign an agreement giving him exclusive rights to Satine. And although Christian and Satine do not yet know it, Satine has been diagnosed with a fatal case of tuberculosis. \r<br />\r<br />\"Moulin Rouge\" is as deeply romantic as any film in recent memory. Christian is a wistful young man who believes in four aspects of life: \"truth, beauty, freedom--and above all others--love.\" Satine, on the other hand, is both a singer/dancer and a prostitute, and has been trained to never fall in love. In one of the film\'s most awe-inspiring, magical sequences, Christian serenades Satine with Elton John\'s \"Your Song,\" to which they get so caught up in their feelings for one another that they are lifted out of the building window and onto the clouds in the sky. For the first time in her life, Satine feels something other than fake emotions for a man in her life, and it\'s an exhilarating rush. Their joy in finding each other does not last, however, as the wealthy duke enters the picture with an unfair proposition to make. \r<br />\r<br />The sparks that actors Ewan McGregor and Nicole Kidman ignite as hopeless romantic Christian and unsure realist Satine are so bright, they\'re almost blinding. Their chemistry, for once, feels genuine, rather than \"written,\" and it is the doomed love story of these two people that turn the movie into such a complex and touching experience. McGregor (1999\'s \"Star Wars: The Phantom Menace\") and Kidman (1999\'s \"Eyes Wide Shut\") are stunning in their roles, eliciting both the passion and determination that any two people have who are in love. Both of them, as well as the rest of the actors, sing their own songs, and they turn out to be startlingly talented at it. Special notice must go to Kidman, who has never been better. Often coming off as somehow aloof, Kidman fills Satine with a warmth that has never before been witnessed from the actress. \r<br />\r<br />Aside from its two stars, where \"Moulin Rouge\" excels is in the almost non-stop barrage of singing. About 85-percent of the story is told through the original art form of song, all of which are classic pop tunes and love ballads from post-1899. Just because we are in turn-of-the-20th-century Paris, director Baz Luhrmann so convincingly argues, doesn\'t necessarily mean that people back then couldn\'t have the right to sing everything from Dolly Parton\'s \"I Will Always Love You,\" to The Beatles\' \"All You Need is Love,\" to David Bowie\'s \"Heroes,\" to Madonna\'s \"Like a Virgin,\" to Sting\'s \"Roxanne,\" to Nirvana\'s \"Smells Like Teen Spirit.\" The film plays like a veritable who\'s who of \'60s, \'70s, and \'80s music, and it is not only smashingly entertaining, but   actually serves a strong purpose within the narrative. Each musical number--and there are a lot of them--are orchestrated with such unabashed energy and passion that you can\'t help but drift away in its rapturous spell. \r<br />\r<br />With \"Moulin Rouge,\" Baz Luhrmann (1996\'s \"William Shakespeare\'s Romeo + Juliet\") has made his first masterpiece as a filmmaker. The camera is constantly moving, swooping around people and objects, or zooming into building windows or through beautiful city landscapes. It is not done to keep the interest of the attention-impaired, though, but to simply aid in creating a glitzy, one-of-a-kind universe. Additionally, the story, written by Luhrmann and Craig Pearce, is just strong enough to be fully satisfying, while not being bogged down by overplotted developments. \r<br />\r<br />In a day when so many motion pictures strive for nothing more than adequacy, \"Moulin Rouge\" is alive with creativity and wonder, proving that the medium of film can take us anywhere, and act upon us in any way possible. One part comedy, one part romance, and one part tragedy, \"Moulin Rouge\" is a remarkable triumph, as well as the first truly brilliant film of 2001.','',100,2,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (114,'SKU114','Heartbreakers','master','',1.00,56.82,'In David Mirkin\'s HEARTBREAKERS, a sweet comedy which plays like a lighthearted version of THE GRIFTERS, Sigourney Weaver and Jennifer Love Hewitt are a mother/daughter pair of con artists. Although they scam for everything from food to gas, their specialty is marriage settlements. \r<br />\r<br />When we first meet our connivers, Max (Weaver) is marrying Dean Cumanno (Ray Liotta), a respectable New Jersey chop shop owner. When his new secretary, Page (Hewitt), entices him into a little oral sex, his wife of 18 hours arrives to catch them in the act. \"Honey, it isn\'t what it looks like here,\" Dean tries to explain to Max. \"Her hair got stuck in my zipper.\" Cut to the lawyers office in which Max leaves with a chunk of cash and one of Dean\'s freshly built Mercedes. \r<br />Although they look like Mutt and Jeff with their dramatic height difference, Weaver and Hewitt are a convincing and funny choice as relatives and rivals. The rebellious Page thinks that Max treats her like a little kid, and Max thinks that Page isn\'t ready to go solo like she plans. Their confidence games are quite believable. Max looks like someone who would sweep you off your feet into an early marriage proposal. And Page, with her lovely legs, micro skirts and ERIN BROCKOVICH-type bras that push her generous breasts skyward, looks like someone who might tempt even the most married of married men. In short, the deliciously caustic chemistry between Weaver and Hewitt is the best part of the movie. \r<br />\r<br />The weakest link, other than the excessive running time, is the supporting cast. Although Liotta is impressive, most of the others are either underutilized or miscast. Anne Bancroft delivers a wooden performance as an IRS agent who forces the two crooks into their most ambitious scam ever. Jason Lee (ALMOST FAMOUS), who isn\'t given much to do as the only guy with whom Page ever falls in love, phones in his performance. \r<br />\r<br />As a clichÈ of a rich old geezer with yellow teeth, Gene Hackman coughs his way through his part as William B. Tensy, a tobacco company CEO with millions to burn. If he will just live long enough to tie the knot with Max, she and her daughter will be able to pay their back taxes and live on easy street for the rest of their lives. But Page hates the whole idea. \"I\'m not dating the walking dead,\" she bitterly informs her mother, who replies, \"we better work fast.\" \r<br />\r<br />In Tensy\'s most memorable line, he reveals the secret of what really turns on a tobacco millionaire -- \"smoke billowing out of a woman\'s hot, red nostrils.\"\r<br />The image almost makes the unflappable, non-smoking Max gag. Gag isn\'t something you will do while watching this brightly written comedy.\r<br />HEARTBREAKERS isn\'t any laugh riot, but it is entertaining fun. It\'s the sort of picture that will leave you with a smile on your face and a feeling that you got your money\'s worth. \r<br />\r<br />HEARTBREAKERS runs needlessly long at 2:03. It is officially rated PG-13 for sex-related content including dialogue, and with scenes of oral sex and bondage, this is certainly a film unsuitable for those under 13. \r<br />','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
