INSERT INTO xcart_products VALUES (135,'SKU135','Psion Netbook','master','',1.00,2468.24,'Processor: Intel SA-1100 StrongARM 190 MHz (the Series 7 has a 133 MHz processor)\r<br />Internal RAM: 32 MB, expandable to 64 MB Internal DRAM (the Series 7 has 16 MB RAM, but see below) one Compact Flash (CF) Card Slot: Type I/II 3.3V/5V. The CF Card slot supports conventional\r<br />Compact Flash Cards as well as the IBM MicroDrive (up to 34 MB of storage(!), both with Live Insertion and Removal one PC Card (Type I/II 3.3V/5V) with serial, modem, Ethernet, and Flash ATA support.\r<br />(Ethernet support is not available now but is promised in 2Q 2000). \r<br />Display: 7.7\" 640x480 color back-lit STN LCD panel \r<br />Pointing device pen and digitizer (touchscreen) 58-key standard layout keyboard. \r<br />12 bit digital sound with speaker and microphone. \r<br />Li-Ion battery with lithium cell, (CR2032) backup                                 External expansion RS232 serial port to 115 kbit/sec IrDA 1.1, 115 kbit/sec and 4 Mbit/sec \r<br />Docking: Optional flatbed docking station provides power and RS232 communications EPOC is loaded at cold power up into RAM from CF card or serial port. The OS is software upgradeable and may be configured to implement some or all of the supplied applications. User defined applications may be added (the Series 7 OS is on an OS Mask ROM module). \r<br />Utilities: Time, Alarms, Calculator, and Voice Recorder PIM: Cotter, Contacts, Agenda, and Data \r<br />Desktop: Word word processor and Sheet Spreadsheet \r<br />Communications: Messaging, Fax, E-mail, and Web Internet browser                        E-mail support: SMITE, Internet POP-3, and IMAP-4 \r<br />Web Support: HTML 3.2, HTTP/1.1, frames, Java applets, GIF/JPEG graphics formats (but not JavaScript)','',100,1,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
