INSERT INTO xcart_products VALUES (143,'SKU143','Acer TravelMate 354TE','master','',1.00,4433.33,'Combining a comprehensive set of features with a lightweight, easy to carry, slimlined shell, the TravelMate 354TE is the perfect PC for mobile users with critical business needs. \r<br />\nProviding powerful performance and portability, at only 1.8kg in weight and less than 4cm in thickness, this notebook is ideal for people who need a powerful, ultra-portable notebook on the road. \r<br />\n\r<br />\nSpecifications\r<br />\n* INTEL Pentium III 850 MHz Processor\r<br />\n* 256Mb SDRAM up-gradable to 512 Mb\r<br />\n* 20 Gb Hard Disk Drive\r<br />\n* Lithium Ion Battery\r<br />\n* 13.3\" TFT Display\r<br />\n* Ultra Slim Form Factor\r<br />\n* 10/100 LAN Adapter\r<br />\n* Smart Card Slot\r<br />\n* Windows ME\r<br />\n* Internal 56K Modem\r<br />\n* 1 year International Travellers Warranty\r<br />','',100,0,'Y',2147483647,2,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (144,'SKU144','NIKON COOLPIX 880 ARGENT','master','',1.00,906.67,'The 880 also has a few features the 990 doesn\'t, most notably the SCENE modes which will make it easy for beginners and more advanced users alike to select a preset shooting mode which puts the camera into\r<br />the correct setup for shooting a particular scene. In addition to this it appears that the SCENE modes also apply differing colour / contrast settings to achieve a certain \"look\" depending on which SCENE you\'ve chosen. Scene shooting modes provided:\r<br />\r<br />- Portrait \r<br />- Party/Indoor \r<br />- Night Portrait \r<br />- Beach/Snow \r<br />- Landscape \r<br />- Sunset \r<br />- Night Landscape \r<br />- Fireworks Show \r<br />- Close up (macro) \r<br />- Copy (black &amp; white) \r<br />- Back light','',100,0,'Y',2147483647,2,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
