INSERT INTO xcart_products VALUES (149,'SKU149','SONY MCV-CD200(CDRW)','master','',1.00,1694.59,'Specifications\r<br />\r<br />- Imaging Device 1/2.7\" Super HAD CCD, 2.1 Million Pixels (gross) \r<br />\r<br />- Optical Zoom Lens Carl Zeiss[tm] Vario Sonnar 3X Optical Zoom Lens \r<br />\r<br />- Focal Distance f = 6.1 - 18.3mm (35mm Equivalent 39 - 117mm) \r<br />\r<br />- Digital Zoom 6X Precision \r<br />- A/D Conversion 14 Bit DXP \r<br />- Flash 3-mode Auto Pop-up Flash with Selectable Red-eye Reduction, Compatible with HVL-F1000 Flash \r<br />- Exposure Control Automatic exposure (Twilight, Portrait and Landscape), Shutter speed priority, Aperture priority, Manual exposure \r<br />- White Balance \r<br />- Automatic, Indoor, Outdoor and One-Push (Hold) \r<br />- Focus Auto/Manual Focus Ring \r<br />- Data System \r<br />- Movie: MPEG1 \r<br />- Still: JPEG, GIF (in TEXT mode, Clip Motion), TIFF \r<br />- Audio with still image: MPEG1 (Monaural) \r<br />- Recording Media 3\" CD-R/CD-RW \r<br />- Shutter Speed Auto (8 sec ~ 1/1000) \r<br />- Self-Timer 10 seconds \r<br />- Filter Diameter 37mm \r<br />- Output Audio/Video out (NTSC/PAL) \r<br />- Date/Time Digital Superimpose \r<br />- Battery Remaining Indicator \r<br />- Drive Read Speed 8X Maximum \r<br />- Drive Write Speed 4X Maximum \r<br />- Image Size UXGA (1600 X 1200), SXGA (1280 x 1024), VGA (640 x 480) \r<br />- Color LCD 2.5\" diagonal TFT (Thin Film Transistor active matrix), 123K pixels \r<br />- USB jack mini-B \r<br />- Battery (Supplied) \r<br />- OS Compatibility Macintosh(R) 8.51/8.6/9.0/9.1, and Microsoft Windows(R) 3.1/95/98/98 SE/Me(R)/NT 4.0, Windows 2000 Professional \r<br />- Weight 1 lb. 6 oz. (610 grams) \r<br />- Dimensions 5?\" x 3-5/8\" x 3-5/8\" (143 x 92 x 92mm)','',100,0,'Y',2147483647,2,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (150,'SKU150','HEWLETT PACKARD PHOTOSMART 912','master','',1.00,548.78,'HP\'s PhotoSmart 912 digital camera, a Single Lens Reflex (SLR) design developed in cooperation with Pentax Corporation, a well-known camera manufacturer with a longstanding record of experience and skill in optics and conventional film-based cameras. The SLR viewfinder allows you to look through the same lens the camera uses to take the picture, so there\'s none of the usual problems with \"viewfinder parallax\" to skew your framing. What you see is what you get!\r<br />Aside from the SLR design, the PhotoSmart 912 is a full-function, 2.2-megapixel camera, with good color and image quality, and a lot of flexibility thanks to its Flashpoint Digita operating system. (Digita provides a platform through which users can actually program their own camera functions. Check http://www.flashpoint.com/ for more information and links to the tools you\'d need.) Overall, HP has created a very feature-rich SLR digicam, at a price far below what other true \"optical\" SLR digicams typically sell.\r<br />\r<br />High Points\r<br />\r<br />- 2.24-megapixel CCD delivering up to 1,600 x 1,280-pixel resolution images. \r<br />- Two-inch color LCD monitor that tilts up 90 degrees. \r<br />- 36-bit color (12 bits per color). \r<br />- Through-the-lens (TTL) optical viewfinder with data display. \r<br />- Pentax 3x, 8.2-25.8mm lens (equivalent to a 34-107mm lens on a 35mm camera). \r<br />- Digital telephoto up to 2x. \r<br />- Manual and automatic focus control. \r<br />- Program AE, Aperture Priority, Shutter Priority, Manual, and special preset exposure modes. \r<br />- Manually adjustable aperture ranging from f/2.5 to f/11. \r<br />- Shutter speeds from 1/1,000 to four seconds. \r<br />- One-shot, Continuous shooting, and Time-Lapse photography modes. \r<br />- Audio recording capability. \r<br />- Exposure lock, EV bracketing, and adjustable metering modes. \r<br />- 25, 50, 100, 200, and 400 ISO equivalents. \r<br />- Adjustable White Balance with five modes. \r<br />- Built-in, pop-up flash with five modes. \r<br />- Hot shoe for mounting an external flash unit. \r<br />- IR Remote Control included. \r<br />- JPEG and uncompressed TIFF file formats. \r<br />- Images saved to CompactFlash memory cards (Type I or II), 16MB card included. \r<br />- Power from four AA batteries (set of alkaline batteries included), or HP Li-Ion battery pack. \r<br />- JetSend Infrared interface. \r<br />- Flashpoint Digita operating interface. \r<br />- Digital Print Order Format (DPOF) compatibility. \r<br />- Software CDs containing HP Photo Imaging Software, ACDSee Systems Viewer, ArcSoft PhotoImpression, and\r<br />- ArcSoft PhotoMontage. \r<br />- USB interface for quick connection to a PC or Macintosh.','',100,1,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (151,'SKU151','HEWLETT PACKARD PHOTOSMART 618','master','',1.00,1536.92,'Hewlett Packard (HP) is one of the true giants of the information age. Its products range from scientific instruments to personal computers, to the most popular line of laser printers in existence. Along the way, HP developed a popular line of digital cameras, inkjet printers, and scanners intended to make digital imaging accessible to the home and small-office user. They\'ve apparently succeeded well in this, as the PhotoSmart 315 camera (reviewed elsewhere on this site) was the biggest-selling camera in the US in the 2000 Christmas season. The PhotoSmart 618 model offers more sophisticated exposure controls than the entry level PhotoSmart 215 and 315 models, plus a host of interesting new features (including time-lapse photography), while still maintaining an affordable price.\r<br />\r<br />The PhotoSmart 618 is a 2.1-megapixel digicam that provides enough exposure control and flexibility to interest sophisticated photo enthusiasts, while still offering a comfortable experience for the beginning photographer. Though small enough to fit into a coat pocket, the 618 has a pleasing heft and solidity when your hands grip the body. Like other PhotoSmart cameras we\'ve tested, it ships with a complete software set that\'s very easy to use -- whether you\'re performing\r<br />image enhancement or arranging multiple shots on a page to get the most out of your inkjet printer. The PhotoSmart looks like a solid midrange performer, in the critical\Zfull-featured, 2-megapixel\" category. It would be a great choice for beginners who are looking for a basic digital camera that can grow with them as they investigate more advanced exposure and creative control.\r<br />\r<br />High Points\r<br />\r<br />- 2.11-megapixel CCD delivering up to 1,600 x 1,200-pixel resolution images. \r<br />- Pentax 3x, 5.2-16.5mm zoom lens (equivalent to a 34-108mm lens on a 35mm camera). \r<br />- Manual and automatic focus control. \r<br />- Up to 2x digital zoom. \r<br />- 2-inch color LCD monitor. \r<br />- 30-bit color depth. \r<br />- Manually adjustable aperture ranging from f/2.4 to f/9.6. \r<br />- Shutter speeds from 1/1,000 to four seconds. \r<br />- Automatic, Aperture Priority, Shutter Priority, Landscape, Portrait, and Action exposure modes. \r<br />- One Shot, Continuous, and Time-Lapse photography modes. \r<br />- Black and White and Sepia tone effects. \r<br />- Built-in flash with seven operating modes. \r<br />- Spot, Average, and Center-Weighted metering. \r<br />- Automatic ISO or selectable 100 and 200 sensitivity settings. \r<br />- Adjustable White Balance with four settings. \r<br />- Audio recording capability. \r<br />- JetSend infrared interface for communicating with other HP JetSend devices. \r<br />- USB interface for quick connection to a PC or Mac. \r<br />- Images saved in JPEG or uncompressed TIFF format on CompactFlash memory cards, 16MB card included. \r<br />- NTSC video cable for viewing images on a television set (PAL for European models). \r<br />- Powered by four AA batteries or optional AC adapter (set of four AA alkaline batteries included). \r<br />- Two software CDs featuring HP Photo Imaging Software, User\'s Guide, and ArcSoft\'s PhotoImpression and\r<br />- PhotoMontage applications. \r<br />- IR Remote Control included. \r<br />- DPOF (Digital Print Order Format) compatibility.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
