INSERT INTO xcart_products VALUES (174,'SKU174','Windows Millennium','master','/provider/windows_me.zip',1.00,355.56,'Microsoft Windows ME (WindowsME, WinME) operating system that will be installed on all new systems for the home &amp; will be the general operating system for most. No matter how good or bad Microsoft Windows ME (WindowsME, WinME) is, it is this that most people will be using. Those of you familiar with Microsoft Win98 will be aware of the great number of updates, bug fixes &amp; so on   that have had to be incorporated in Win98 SE. Microsoft Win ME (WindowsME, WinME) at least incorporates them so you can make a relatively clean install from the start and not spend hours downloading all the necessary updates &amp; bug fixes as users of Win 98 (Win98) know all to well. In essence Microsoft Win ME (WindowsME, WinME) does not give much for your money. More stable system is Microsoft Windows 2000 or even better Windows Whistler 2001 when it is on sale.\r<br />\r<br />Microsoft Windows ME (WindowsME, WinME) boots up quicker because it does not process the config.sys &amp; autoexec.bat &amp; does not display the whole MS-DOS user interface. Microsoft Win ME (WindowsME, WinME) boots up about 25%+ quicker BUT only on new PC\'s that are designed to. Existing PC will only boot up a couple of seconds quicker. On the down side Windows ME works just a little slower, 5% or less slower than Win98, probably caused by the PC Health check features running all the time.\r<br />\r<br />Microsoft have produced two versions. One \"Windows Me Step-up\" can ONLY upgrade a fully running copy of Win98 &amp; Win98 SE, they are selling cheaper but it will not allow a clean install, for that you must buy the normal upgrade version.\r<br />\r<br />','',100,3,'Y',2147483647,8,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
