INSERT INTO xcart_products VALUES (177,'SKU177','HP LaserJet 1200 + cable 2m','master','',1.00,882.35,'Hewlett-Packard\'s LaserJet 1200 is poised to replace the HP LaserJet 1100xi, a low-cost laser we\'ve known and loved\r<br />                                            for its excellent print quality and its versatile copy/scan attachment. Improving on a good thing can be difficult, but in this\r<br />                                            case, HP succeeds admirably. The LaserJet 1200 fixes all the things we disliked about the 1100xi and delivers better print\r<br />                                            quality at faster speeds--all for the same low price.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (178,'SKU178','HP LaserJet 2100M + cable 2m','master','',1.00,1392.41,'Hewlett-Packard\'s HP LaserJet 2100 family of printers replaces their successful line of HP LaserJet 6P/6MP printers. Designed for advanced individual users or small workgroups, the 2100M is able to produce 1200 x 1200 dpi resolution at 10 pages-per-minute print speed. The printer is expandable, has two paper trays, and features Postscript II emulation and 8 MB of memory. \r<br />\r<br />The printer is designed for use in mixed language environments\r<br />\r<br />\"The LaserJet 2100 series printer provide the fastest output at 1200 x 1200 dpi of any printer in their class, making the LaserJet 2100 series a no-compromise, complete printing solution for professional business needs,\" said Tom Abshire, a product manager at HP\'s Personal LaserJet Division. \"These printers represent technology advancements geared toward making document creation more productive and compelling for office teams and business professionals.\"','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (179,'SKU179','HP LaserJet 2200D + cable 2m','master','',1.00,1666.67,'For small businesses with diverse printing needs, the Hewlett-Packard LaserJet 2200D printer offers network capability, 1,200-dpi resolution, 19-pages-per-minute print speed, 8 MB of RAM (expandable to 72 MB), and a 133 MHz processor to ensure consistency. Built-in duplexing and multiple paper trays improve efficiency and speed, and the large capacity 2200D printer has 40,000-page monthly duty cycle. \r<br />\r<br />Two paper trays support standard input capacities of 200 and 100 sheets, reducing paper reloading, and the straight-through paper path allows for flexible and jam-free handling of different media sizes and weights. Automatic duplexing is standard, saving paper with two-sided printing, and print orientation options includes booklet printing. An instant-on fuser minimizes the warm-up time (first page out in less than 15 seconds), so you can get to work without delays. \r<br />\r<br />The Hewlett-Packard Color LaserJet 2200D is designed to grow as your business does with network options, additional paper trays, and one wireless infrared port. Compatible with Windows and Macintosh operating systems, it offers USB connectivity, automatic language switching, and it\'s designed to excel in mixed-language environments. The 2200D comes with a one-year warranty and HP Express Exchange.','',100,0,'Y',2147483647,0,0,0,0.00,'N','Y',1,0,0,0,10,'N','N',0,0,'');
INSERT INTO xcart_products VALUES (182,'SKU182','Hunting Knife w/sheath','master','',0.50,280.00,'This 8 1/4 \" beauty will make a great addition to your knife collection or a great gift for that special person.<br /><br />\r\n\r\nA quality hunting knife with a heavy 4-inch blade and an overall length of 8.25-inches. Hand crafted from only the finest materials, including full Tang high-carbon no-stain steel. Featuring a non-slip handle to give you a good grip in all environments. Incredibly sharp, perfectly balanced. A lifetime guarantee against breakage. Limited run of 50 pieces, each knife is serial numbered.  Comes with a hand-made leather sheath.\r\n','',10,0,'Y',1144836502,0,0,0,0.00,'N','Y',1,0,0,0,2,'N','N',0,0,'');
